import React, { useState } from "react";
import "./dropDown.css";

const Dropdown = (props) => {

  const [openDropDown, setOpenDropDown] = useState(false);
  return (
    <>
      <div className="flex flex-col dropDownList">
        <ul className="flex flex-col gap-4">
          <li>Edit</li>
          <li>Delete</li>
        </ul>
      </div>
    </>
  );
};

export default Dropdown;
